description:
4Media iPod to PC Transfer is excellent iPhone/iPod to PC transfer and management software. It can transfer music, videos, photos, podcast, and TV shows on your iPod/iPhone to PC and add them to your local iTunes library. This iPod transfer tool also transfers music and video files formatted as AAC, MP3, MP4, MOV, WAV from PC to iPod/iPhone and allows you to create, rename and delete playlists. With it, you can manage photos with ease, and use iPhone like a portable hard disk. 

Key Features: Transfer iPod/iPhone music, video and photo to your PC at high speed; Add and Transfer music or movies on your iPod/iPhone to iTunes library; Feature friendly interface and easy-to-handle process; Allow you to create, rename and delete a playlist on iPod/iPhone; Support drag-and-drop; Support all types of iPod.

